import React from 'react';
import { Container, Typography, Button } from '@mui/material';

const Home = () => {
  return (
    <Container>
      <Typography variant="h2" gutterBottom>Welcome to Our E-learning Platform</Typography>
      <Typography variant="h5" gutterBottom>Learn at your own pace with our comprehensive courses.</Typography>
      <Button variant="contained" color="primary" href="/courses">Browse Courses</Button>
    </Container>
  );
};

export default Home;
